create table dept
(
    id            BIGINT(19) auto_increment comment 'ID'
        primary key,
    name          VARCHAR(255) not null comment '名称',
    pid           BIGINT(19)   not null comment '上级部门',
    create_time   DATETIME(19) null,
    enabled       BIT          not null,
    number        LONGTEXT(max) null,
    code          VARCHAR(255) null,
    logo          VARCHAR(255) null,
    bike_icon     VARCHAR(255) null,
    app_id        VARCHAR(255) null,
    secret        VARCHAR(255) null,
    token         VARCHAR(255) null,
    aes_key       VARCHAR(255) null,
    city_phone    VARCHAR(255) null,
    dept_phone    VARCHAR(255) null,
    longitude     VARCHAR(255) null,
    latitude      VARCHAR(255) null,
    check_license BIT          not null
);

